    const carousel = <div className='rolling_carousel row'></div>;


    const items = [];

    const products = [1, 2, 3, 4, 5, 6];



    products.forEach((product, idx) => {
        var item = (<div className='rolling_item col'>
            <div className={`align_${idx}`}></div>
        </div>);
        items.push(item);
    });

    return <div className='rolling_carousel row'>
        {setup()}
        {items.map(item => {
            return item;
        })}
    </div>;
}

export default RollingCarousel;
